const HandleDownload = () => {
    const configuration = JSON?.parse(json_code_block.textContent);
    const loader = document.getElementById('loader');
    loader.classList.remove('d-none');
    setTimeout(() => {
        const html = document.createElement('div');
        html.innerHTML += document.getElementById('logo-container').outerHTML;
        html.innerHTML += document.getElementById('append-styles').outerHTML;
        html.style = `display: flex; justify-content: center; align-items: center;padding: 10px;height: ${configuration['download-height'] ?? 1000}px; width: ${configuration['download-width'] ?? 1000}px;`;
        document.body.append(html);
        html2canvas(html, {
            backgroundColor: configuration['backgroundColor'] ?? null,
        }).then( canvas => {
            html.remove();
            loader.classList.add('d-none');
            const pngUrl = canvas.toDataURL('image/png');
            const download = document.createElement('a');
            download.href = pngUrl;
            download.setAttribute('download', 'logo.png');
            download.click();

        });    
    }, 1000);
}

const ConvertImage = e => {
    const reader = new FileReader();
    reader.onloadend = () => {
        html_code_block.textContent += `<img src="${reader.result}" />`;
        Preview(true);
    };
    reader.readAsDataURL(e.target.files[0]);
};

const UploadImage = _ => {
    const file = document.createElement('input');
    file.type = 'file';

    file.addEventListener('change', ConvertImage);
    file.click();
};

const Preview = removeExistingHighlight => {
    if(removeExistingHighlight) {
        delete html_code_block.dataset.highlighted;
        delete css_code_block.dataset.highlighted;
        delete json_code_block.dataset.highlighted;
    }
    logo_container.innerHTML = html_code_block.textContent;
    main_style.textContent = css_code_block.textContent;
    hljs.highlightElement(html_code_block);
    hljs.highlightElement(css_code_block);
    hljs.highlightElement(json_code_block);
};

const html_code_block = document.getElementById('writer-html-code');
const css_code_block = document.getElementById('writer-css-code');
const json_code_block = document.getElementById('writer-json-code');
const main_style = document.getElementById('append-styles');
const logo_container = document.getElementById('logo-container');

hljs.configure({ ignoreUnescapedHTML: true });

document.querySelectorAll('#writer-tabs [tab]').forEach(el => {
    el.addEventListener('click', e => {
        const element = el.closest('[tab]');
        if(element.classList.contains('active')) return;
        document.querySelector('#writer-tabs [tab].active')?.classList.remove('active');
        document.querySelector('#writer pre:not(.d-none)')?.classList.add('d-none');
        element.classList.add('active');
        document.querySelector(`#writer pre[tab="${element.getAttribute('tab')}"]`)?.classList.remove('d-none');
    });
});

document.getElementById('upload_image_btn').addEventListener('click', UploadImage);
document.getElementById('render_image_btn').addEventListener('click', e => Preview(true));

document.getElementById('download_image_btn').addEventListener('click', HandleDownload);

{
    document.getElementById("writer-html-code").textContent = `<!-- Example code -->
<img id="image-container" src="data:image/png;base64," />`;
}

Preview(false);